import React from 'react'
import './Child1.css'
import P5Wrapper from 'react-p5-wrapper';
import sun from './sketches/sun';
import co2Length from './sketches/sun'


class Child1 extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {

        return (
          <P5Wrapper sketch={sketch()} ></P5Wrapper>
        );
    }

    componentDidMount() {
        console.log("Child1 Mounted");
    }

    componentDidUpdate(prevProps, prevState, snapshot) {
        console.log("Child1 Updated");
        console.log(this.props); // access data from props; prints data after re-render
        // recall that setting the state forced re-render, causing componentDidUpdate() to be called by children

    }
    sketch(p) {
        let canvas;

        p.setup = () => {
            canvas = p.createCanvas(600, 600);
            p.noStroke();
        }

        p.draw = () => {
            p.background('blue');
            p.ellipse(300, 300, 100, 100);
            //p.fill(color)
        }

        p.myCustomRedrawAccordingToNewPropsHandler = (newProps) => {
          if(canvas) //Make sure the canvas has been created

            console.log(newProps);
            //color = newProps.color
            //co2Length = newProps.co2Length
            console.log(this);
            console.log(newProps);
          }

    }
}

export default Child1
